Given the decompiled code as input, it appears to be a simple smart contract that doesn't allow any transactions by default and would revert any fallback calls. Here is the equivalent Solidity contract code:

```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract MyContract {

    fallback() external {
        revert("Fallback function called!");
    }

    receive() external payable {
        revert("Receive function called!");
    }
}
```

In the above Solidity smart contract, the `fallback()` function is used to handle transactions that do not match any other function in the contract and it's not payable, meaning it can't receive Ether. The `receive()` function is a special function that is run when the contract directly receives Ether along with a regular transaction.

Both the `fallback()` and `receive()` functions are set to `revert`, which means the transaction will fail and all changes to the Ethereum state will be reverted if these functions are called.
